var JSON2CSV = function(objArray) {
    var array = typeof objArray != 'object' ? JSON.parse(objArray) : objArray;
    var line = '';
    var index;
    var value;
    var keys = [];
   for(var k in objArray[0]) { keys.push(k); }
   var str = keys.toString()+'\r\n';
    if ($("#labels").is(':checked')) {
        var head = array[0];
        if ($("#quote").is(':checked')) {
            for (index in array[0]) {
                value = index + "";
                line += '"' + value.replace(/"/g, '""') + '",';
            }
        } else {
            for (index in array[0]) {
                line += index + ',';
            }
        }

        line = line.slice(0, -1);
        str += line + '\r\n';
    }

    for (var i = 0; i < array.length; i++) {
        line = '';

        if ($("#quote").is(':checked')) {
            for (index in array[i]) {
                value = array[i][index] + "";
                line += '"' + value.replace(/"/g, '""') + '",';
            }
        } else {
            for (index in array[i]) {
                line += array[i][index] + ',';
            }
        }

        line = line.slice(0, -1);
        str += line + '\r\n';
    }
    return str;
}

window.JSON2CSV=JSON2CSV;
